let state = {
    profilePage: {
        posts: [
            { id: 1, message: 'Hey, girls! The good day!', like_count: 3, src: 'https://superbody.pro/user_files/11/avatar/171e984f4e.jpg' },
            { id: 2, message: 'Upyyyyyyy... Puppy....Cats', like_count: 5, src: 'https://www.ivi.ru/titr/uploads/2018/09/07/1fa60b0d6c039238929ec46a42076230.png/1400x0'},
            { id: 3, message: 'x-ray in medcine rules', like_count: 12, src: 'https://www.sportsamara.ru/assets/images/trainers/6346/nifadeva_ksenia.jpg'  }
        ]
        
    },
    dialogsPage: {
        messages: [
            { id: 1, message: 'Hi! How are you?' },
            { id: 2, message: 'How is your job? Finished the redesign?' },
            { id: 3, message: 'Maybe we will meet in the evening?' }
        ],
        dialogs: [
            { id: 1, name: 'Hanna' },
            { id: 2, name: 'Nikolay' },
            { id: 3, name: 'Andrey' },
            { id: 4, name: 'Anastaysha' },
            { id: 5, name: 'Alex' }
        ]
    }
}

export default state;
